INSERT INTO `sys_oper_log` VALUES (494, '追踪日志', 1, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.add()', 'POST', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"bj872808\",\"createTime\":1701702493545,\"id\":9,\"params\":{},\"content\":\"<h2>1.是不是好生意</h2><p><br></p><p>          1.1怎么赚钱：常年保持较高的ROE, 高于常规制造业的营业净利润, 以及较高的周转率</p><p><br></p><p>            1.1.1商业模式 : </p><p><br></p><p>            1.1.2经营模式:采购,生产,销售</p><p><br></p><p>              *主营业务收入构成:</p><p><br></p><p>            1.1.3.成本构成:</p><p><br></p><p>          1.2能不能持续：护城河</p><p><br></p><p>          1.3能不能增长：</p><p><br></p><p><br></p><h2>2.现金流状况</h2><p><br></p><p><br></p><h2>3.关键财务指标分析</h2><p><br></p><h3>3.1安全性</h3><p><br></p><h3>3.2盈利能力分析</h3><p><br></p><h3>3.3成长性:</h3><p><br></p><h3>3.4管理能力:在一个固定周期,对企业资源的利用次数</h3><p><br></p><p><br></p><h2>4.行业竞争格局和公司的比较优势</h2><p><br></p><p><br></p><h2>5.股权结构,散户数量</h2>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-12-04 15:08:13');
INSERT INTO `sys_oper_log` VALUES (495, '追踪日志', 2, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.edit()', 'PUT', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"bj872808\",\"createTime\":1701702494000,\"updateTime\":1701704992308,\"id\":9,\"delFlag\":\"0\",\"params\":{},\"content\":\"<h2>1.是不是好生意</h2><p><br></p><p>          1.1怎么赚钱：常年保持较高的ROE, 高于常规制造业的营业净利润, 以及较高的周转率</p><p><br></p><p>            1.1.1商业模式 : 有一定技术壁垒, 有落地案例, 目前为行业龙头, 占比58%, </p><p><br></p><p>            1.1.2经营模式:承接数据中心建设或销售液冷产品</p><p><br></p><p>              *主营业务收入构成: 依靠<span style=\\\"background-color: rgb(254, 254, 254); color: rgb(0, 0, 0);\\\">浸没相变液冷产品, 冷板产品占比较低</span></p><p><br></p><p>            1.1.3.成本构成: 营业成本占营业收入的60%, 费用较低</p><p><br></p><p>          1.2能不能持续：有一定技术壁垒, 有一定产业链优势, 隶属中科曙光的服务器厂商</p><p><br></p><p>          1.3能不能增长：目前液冷渗透率较低, 6%-8%, 随着AI发展市场空间必定进一步扩大</p><p><br></p><p><br></p><h2>2.现金流状况</h2><p><br></p><p>\\t+ - + , 蛮牛型, 企业处于扩张期</p><p><br></p><p><br></p><h2>3.关键财务指标分析</h2><p><br></p><h3>3.1安全性 较高</h3><p><br></p><h3>3.2盈利能力分析 高</h3><p><br></p><h3>3.3成长性: 高</h3><p><br></p><h3>3.4管理能力:在一个固定周期,对企业资源的利用次数, 较高</h3><p><br></p><p><br></p><h2>4.行业竞争格局和公司的比较优势</h2><p><br></p><p>浸没式液冷几乎没有对手</p><p><br></p><h2>5.股权结构,散户数量</h2><p><br></p><p>筹码集中</p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-12-04 15:49:52');
